import React from 'react'
import Netflix from './Netflex'
import Amazone from './Amazone'

const favSeries = 'amazone'

function App() {
  return (
    <>
      <h1>Hello This is Shyam</h1>

      {favSeries === 'amazone' ? <Amazone /> : <Netflix />}
    </>
  )
}

export default App
